    "2016-07-27T22:51:04.874985",nt"name": "blackbeard-island-national-wildlife-refuge-loggerhead-sea-turtle-nest-monitoring-end-of-s-",nt"isopen":
    false,nt"url": null,nt"notes": "The 2013 Loggerhead sea turtle nesting
    season resulted in 284 nests with 17,915 emerged hatchlings.  Of the 284 nests,
    162 (57%) remained in situ with 122 (43%) nests relocated above the mean high tide
    line.  Only 13 nests were lost from various threats such as hog and raccoon predation
    and tide overwash.  The mean hatch success rate was 62.3% with 19,315 hatched eggs.
     Single eggs were taken from 278 nests for DNA analysis.  One leatherback sea turtle
    nested but the nest was unsuccessful.",nt"license_title": "License Not Specified",nt"extras":
